import { Carousel } from "../Portal";

const Carousel_Title = ({ title, type, thing, options = null }) => {
  return (
    <section className="container padding text-center">
      {title && <h3 className="title mb-10 mac-bg"></h3>}
      <div className="px-5">
        <Carousel type="company" type={type} things={thing} options={options} />
      </div>
    </section>
  );
};

export default Carousel_Title;
